    "2016-07-27T23:05:08.634683",nt"name": "a-habitat-based-approach-to-management-of-tallgrass-prairies-at-the-tewaukon-national-wild",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of this report is to provide
    specific, measurable habitat objectives to guide habitat management efforts to manintain
    or restore native biodiversity within the tallgrass prairie at Tewaukon NWR. This
    report presents information on: (1) an overview of tallgrass prairie ecosystems;
    (2) identification of resources of concern; (3) habitat and life history information
    for the resources of concern; (4) establishing habitat objectives; (5) potential
    habitat management strategies; and (6) monitoring, evaluation, and adaptive management.",nt"license_title":
